return'<div class="js_cps_container">\n  <!--新商品选择 begin-->\n  <div class="dialog-select-new-product">\n    <div class="dialog_topbar js_cps_all_count" style="display: none;">共有1234条搜索结果</div>\n    <!--切换 begin-->\n    <div class="weui-desktop-tag__wrp">\n      <!--tab数据没出来之前，隐藏这块-->\n      <div class="weui-desktop-tags__wrp js_category_forhide">\n          <ul class="weui-desktop-tags js_category_container"></ul>\n          <!--展开更多 begin-->\n          <button class="weui-desktop-tag__more-btn js_showmore_btn">展开更多</button>\n          <a class="weui-desktop-tag__extend js_see_income" href="javascript;" target="_blank">查看返佣收益</a>\n          <!--展开更多 end-->\n      </div>\n    </div>\n    <!--切换 end-->\n    <!--支持不同数量选项时候下拉菜单 begin-->\n    <!--有多项时，加className more-->\n    <!--支持不同数量选项时候下拉菜单 end-->\n    <!--有数据 begin-->\n    <div class="dialog-select-product-area js_common_container">\n      <!--搜索 begin-->\n      <!--<div class="product-filter">\n        <div class="global_mod float_layout gap_top" id="searchDiv">\n          <div class="weui-desktop-form__control-group weui-desktop-form__control-group_offset gap_top_extend">\n            <label for="" class="weui-desktop-form__label">只看有佣金商品</label>\n            <div class="weui-desktop-form__controls">\n              <label class="weui-desktop-switch">\n                <input class="weui-desktop-switch__input js_onlyshowcommission" type="checkbox">\n                <div class="weui-desktop-switch__box"></div>\n              </label>\n            </div>\n          </div>  \n          <span class="global_info frm_input_box search with_del append">\n              <a class="del_btn js_search_clear_btn" style="display: none;" href="javascript:;"><i class="icon_search_del"></i>&nbsp;</a>\n              <a  id="searchBt" href="javascript:;" class="frm_input_append"><i class="icon16_common search_gray js_search_submit">搜索</i>&nbsp;</a>\n\n              <span class="tab_select_tag">电影</span>\n\n              <input id="keyInput" type="text" placeholder="输入商品名称搜索" value="" class="frm_input js_search_word">\n          </span>\n        </div>\n      </div>-->\n      <!--切换、搜索 end-->\n\n      <!--商品选择列表 begin-->\n      <div class="product_table_wrp table_wrp">\n        <div class="table_wrp skin_list ">\n          <div class="table_ele table_head">\n            <div class="table_cell product-cell__select">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</div>\n            <div class="table_cell product-cell__name  js_category_selected_wording">\n                <div class="product-filter js_fornotag">\n                  <div class="" id="searchDiv">\n                    <span class="global_info frm_input_box search with_del append">\n                        <a class="del_btn js_search_clear_btn" style="display: none;" href="javascript:;"><i class="icon_search_del"></i>&nbsp;</a>\n                        <a  id="searchBt" href="javascript:;" class="frm_input_append"><i class="icon16_common search_gray js_search_submit">搜索</i>&nbsp;</a>\n                        <!--已选tag begin-->\n                        <span class="tab_select_tag js_search_tag">电影</span>\n                        <!--已选tag end-->\n                        <input id="keyInput" type="text" placeholder="输入商品名称搜索" value="" class="frm_input js_search_word">\n                    </span>\n                  </div>\n                </div>\n            </div>\n            <div class="table_cell product-cell__from js_source_container"></div>  <!-- 选择的来源 -->\n\n            <!--当被选中，这里加className selected-->\n            <div class="table_cell product-cell__ratio weui-desktop-table_rank">   <!-- 排序等于0：正常排序 -->\n              <span class="js_commission_sort" data-sort_type="0"></span><a href="javascript:;" class="icon_msg_mini ask js_commission_ask"></a>\n            </div>\n            <div class="table_cell product-cell__qrcode">\n              商品二维码            </div>\n          </div>\n            <ul class="table js_cps_list js_cps_list_scroll_area"></ul>   <!-- 当改动滚动条位置的时候记得把 js_cps_list_srcoll_area 一并移过去 -->\n        </div>\n      </div>\n      <!--商品选择列表 end-->\n      <div class="tool_bar_topextend js_selected_cnt_container">\n        <!-- <div class="js_cancel_all">取消选择</div>> -->\n        <p>已经选择<span class="js_selected_cnt"></span>个商品&nbsp;\n          <a class="js_cancel_all" href="javascript:void(0)">取消选择</a>\n        </p>\n      </div>\n    </div>\n    <!--有数据 end-->\n\n    <!-- 图书展示 start -->\n    <div class="dialog-select-product-empty-area js_special_container" style="display: none;">\n      <div class="empty_tips">敬请期待</div>\n    </div>\n    <!-- 图书展示 end -->\n  </div>\n <!--新商品选择 end-->\n\n    \n  <!-- 查看选择失败的所有商品 begin-->\n  <div class="js_impor_select_main page_msg small default" style="display: none;">\n    <div class="inner group">\n          <span class="msg_icon_wrp">\n              <i class="icon_msg warn"></i>\n          </span>\n      <div class="msg_content">\n        <h4>选择失败</h4>\n        <p>列表中所有商品都无法选择<a href="" class="js_link">查看选择失败的所有商品</a></p>\n      </div>\n    </div>\n  </div> \n  <!-- 查看选择失败的所有商品 end-->\n\n\n\n  <!--佣金气泡内容 begin-->\n  <div class="popover_content ratio js_commission_explain" style="display: none;">\n    <p>用户购买后，你将获得佣金，佣金=用户实际支付金额x商品的佣金比例，详细佣金计算及结算规则请参考流量主<a href=" https://wximg.qq.com/wxp/pdftool/get.html?id=r1beBhR2f&pa=12"  target="_blank">帮助文档</a></p>\n    <div class="popover_ratio_extend">\n      <a class="btn btn_default js_see_income" href="javascript;" target="_blank">查看佣金收益</a>\n    </div>\n  </div>\n  <!--佣金气泡内容 end-->\n\n\n <!--二维码气泡内容 begin-->\n  <div class="popover_content qrcode  js_qrcode_succ"  style="display: none;">\n      <p class="popover_qrcode_title">扫码在手机上查看商品详情</p>\n      <div class="popover_qrcode_container">\n        <img src="" class="popover_qrcode_img js_qrcode_img_url"/>   \n      </div>\n  </div>\n  <!--二维码气泡内容 end-->\n\n\n\n  <!--二维码加载失败气泡内容 begin-->\n  <div class="popover_content qrcode_fail js_qrcode_fail"  style="display: none;">\n    <p>二维码加载失败，请稍后查看</p>\n  </div>\n  <!--二维码加载失败气泡内容 end-->\n\n\n   <!-- 选择了无佣金提示 begin -->\n  <div class="page_msg small default single_line cps_no_commission_dialog_content" id="js_choice_no_commission_tip"  style="display: none;">\n    <div class="inner group">\n      <span class="msg_icon_wrp">\n        <i class="icon_msg info"></i>\n      </span>\n      <div class="msg_content">\n        <p>你选择的商品中包含无佣金商品，这部分商品没有佣金收益</p>\n      </div>\n    </div>\n  </div>\n  <!-- 选择了无佣金提示 end -->\n\n  <!-- 无法添加商品 begin-->\n  <div class="page_msg small default cps_no_commission_dialog_content goods" id="js_can_not_insert_tip" style="display: none;">\n    <div class="inner group">\n      <span class="msg_icon_wrp">\n        <i class="icon_msg warn"></i>\n      </span>\n      <div class="msg_content">\n        <h4>无法添加商品，因为你不符合流量主开通条件</h4>\n        <p><a href="https://wximg.qq.com/wxp/pdftool/get.html?id=r1beBhR2f&pa=12" target="_blank">了解更多</a></p>\n      </div>\n    </div>\n  </div>\n  <!-- 无法添加商品 end-->\n\n\n  <!-- 自动开通流量主 begin-->\n  <div class="page_msg small default cps_no_commission_dialog_content auto_add_goods" id="js_will_be_publisher_tip" style="display: none;">\n    <div class="inner group">\n      <span class="msg_icon_wrp">\n        <i class="icon_msg info"></i>\n      </span>\n      <div class="msg_content">\n        <h4>添加商品，将自动开通流量主</h4>\n        <p>商品带来的广告收益可在流量主查看 <a href="https://wximg.qq.com/wxp/pdftool/get.html?id=r1beBhR2f&pa=12" target="_blank">了解更多</a></p>\n        <p>\n            <label class="frm_checkbox_label js_checkbox">\n              <i class="icon_checkbox"></i>\n              <span class="lbl_content">我已阅读并同意<a href="https://mp.weixin.qq.com/cgi-bin/readtemplate?t=home/adhost_agreement_tmpl" target="_blank">《腾讯微信公众平台广告展示服务协议》</a></span>\n              <input type="checkbox" class="frm_checkbox js_agreed" id="">\n            </label>\n        </p>\n      </div>\n    </div>\n  </div>\n  <!-- 自动开通流量主 end-->\n</div>\n\n';
